import './App.css';
import {Route, Routes} from "react-router-dom";
import Home from "./homePage";
import Login from "./loginPage";


function App() {
  return (
      <>
          <nav>
              <ul>
                  <li></li>
              </ul>
          </nav>
          <Routes>

              <Route path='/' element={<Home/>} />
              <Route path='/loginPage' element={<Login/>} />

          </Routes>
      </>


  );
}

export default App;
